import React from 'react'

function DivItems(props:any) {
  return (
      (props.name === 'Task 1')
      ?<div>
            <ul><li>Hello</li></ul>
        </div>: <div>
            <ul><li>Hi</li></ul>
        </div>
  );
}

export default DivItems;
